int
init_jap(int lgno) {

    register int  i;
    unsigned long cid;

    if (jap_MAX_TRIGs) {
        languages[lgno].dict = make_dict(2 * jap_MAX_TRIGs, 0);
        languages[lgno].hash = (double *)malloc(sizeof(double) * jap_MAX_TRIGs);
        if (!languages[lgno].hash) return(1);
        for (i = 0; i < jap_MAX_TRIGs; i++) {
           cid = string2id((char *)jap_hash[i].trig, languages[lgno].dict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].hash[cid] = jap_hash[i].prob;
        }
        languages[lgno].wdict = (dict_t *)NULL;
        languages[lgno].whash = (double *)NULL;
    } else languages[lgno].used = 0;

    return(0);
}
